import React from 'react';
import styled from 'styled-components';
import LogoImage from '../images/logo.svg'; // Assurez-vous que le chemin est correct

const LogoContainer = styled.img`
  position: absolute;
  width: ${({ size }) => size || '300px'};
  top: ${({ top }) => top || '50%'};
  left: ${({ left }) => left || '50%'};
  transform: translate(100%, -50%);
  transition: width 1s ease, top 1s ease, left 1s ease, transform 1s ease;
  z-index: 100000001; /* Un z-index plus élevé pour s'assurer qu'il est au-dessus du LoadingScreen */
  pointer-events: none; /* Empêche le logo de bloquer les clics */
`;

const Logo = ({ size, top, left }) => {
  return <LogoContainer src={LogoImage} alt="Logo" size={size} top={top} left={left} />;
};

export default Logo;
